import './App.css';
import React, { Component } from 'react';
import Sign from './Sign/Sign';
import Auth from './Auth/Auth';
import Space from './Space/Space';
import Nav from './Nav/Nav';

class App extends Component {
render() {
  return (
    <div className="App">
      <header className="App-header">
        <Nav />
        <Auth />
        <Space /> 
        <Sign />

    </header>
    </div>
  );
}
}
export default App;
